import {useSelector} from 'react-redux';

export const TodoList=()=>{
    const {todos}=useSelector((state)=>state);

    return (
        <div>
            {todos.map((todo)=>(
                <div key={todo.id}>
                    <p >{todo.title}{'-->'}{todo.status?"Complete":"Incomplete"}</p>
                    <button>Toggle</button>
                    <button>Delete</button>
                </div>
            ))}
        </div>
    )

}
